Turns `self` into an [`AuthorisedEntry`] by creating an authorisation token for it.

```
use rand::rngs::OsRng;
use willow25::prelude::*;
use willow25::authorisation::PossiblyAuthorisedEntry;

# #[cfg(feature = "dev")] {
let mut csprng = OsRng;
let (subspace_id, secret) = randomly_generate_subspace(&mut csprng);
let namespace_id = NamespaceId::from_bytes(&[17; 32]);

let entry = Entry::builder()
    .namespace_id(namespace_id.clone())
    .subspace_id(subspace_id.clone())
    .path(path!("/ideas"))
    .timestamp(12345)
    .payload(b"chocolate with mustard")
    .build().unwrap();

let mut cap = WriteCapability::new_communal(
    namespace_id.clone(),
    subspace_id.clone(),
);

let authed = entry.authorise(&cap, &secret).unwrap();

assert_eq!(authed.entry(), &entry);
# }
```

2035.docs:
Returns the `i`-th [`Component`] of `&self`, without checking whether `i < self.component_count()`.

#### Safety

Undefined behaviour if `i >= self.component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(unsafe { p.component_unchecked(0) }, component!("hi"));
assert_eq!(unsafe { p.component_unchecked(1) }, Component::new(b"ho")?);
# Ok::<(), PathError>(())
```

146.docs:
Returns by value the [area to which this grants access](https://willowprotocol.org/specs/meadowcap/index.html#cap_granted_area) (and simply assumes the capability is valid).

Prefer using [`includes`](PossiblyValidReadCapability::includes), [`includes_area`](PossiblyValidReadCapability::includes_area) or [`granted_area_ref`](PossiblyValidReadCapability::granted_area_ref) whenever applicable, as these are more efficient.

```
use willow25::prelude::*;
use willow25::authorisation::raw::*;

# #[cfg(feature = "dev")] {
let namespace_id = NamespaceId::from_bytes(&[16; 32]);
let subspace_id = SubspaceId::from_bytes(&[17; 32]);

let mut cap = PossiblyValidReadCapability::new_owned(
    namespace_id.clone(),
    subspace_id.clone(),
    NamespaceSignature::from([18; 64]),
);

assert_eq!(cap.granted_area(), Area::full());

let delegation = Delegation::new(
    Area::new_subspace_area(subspace_id.clone()),
    SubspaceId::from_bytes(&[18; 32]),
    SubspaceSignature::from([19; 64]),
);

cap.append_delegation(delegation.clone());

assert_eq!(cap.granted_area(), Area::new_subspace_area(subspace_id));
# }
```

