409.docs:
Delegates this capability, returning an error if the resulting granted area would not be included in the previous granted area, or if the public key of the keypair was not the receiver of the capability pre-delegation.

```
use rand::rngs::OsRng;
use willow25::{prelude::*, authorisation::*};

# #[cfg(feature = "dev")] {
let mut csprng = OsRng;
let (subspace_id, secret) = randomly_generate_subspace(&mut csprng);
let (_subspace_id2, secret2) = randomly_generate_subspace(&mut csprng);
let namespace_id = NamespaceId::from_bytes(&[17; 32]);
let new_receiver = SubspaceId::from_bytes(&[18; 32]);

let mut cap = WriteCapability::new_communal(
    namespace_id,
    subspace_id.clone(),
);

// Trying to delegate with an invalid secret fails.
assert!(
    cap.try_delegate(
        &secret2,
        Area::new_subspace_area(subspace_id.clone()),
        new_receiver.clone(),
    ).is_err()
);

// Trying to delegate to a greater area fails.
assert!(
    cap.try_delegate(
        &secret,
        Area::full(),
        new_receiver.clone(),
    ).is_err()
);

// Delegating with the correct secret and to a contained area succeeds.
assert!(
    cap.try_delegate(
        &secret,
        Area::new_subspace_area(subspace_id.clone()),
        new_receiver.clone(),
    ).is_ok()
);
# }
```

2044.docs:
Creates a new [`Path`] that consists of the first `component_count` [`Component`]s of `&self`. More efficient than creating a new [`Path`] from scratch.

#### Safety

Undefined behaviour if `component_count` is greater than `self.component_count()`. May manifest directly, or at any later
function invocation that operates on the resulting [`Path`].

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow25::prelude::*;
let p: Path = path!("/hi/ho");
assert_eq!(unsafe { p.create_prefix_unchecked(0) }, Path::new());
assert_eq!(unsafe { p.create_prefix_unchecked(1) }, Path::from_slice(b"hi")?);
assert_eq!(unsafe { p.create_prefix_unchecked(2) }, path!("/hi/ho"));
# Ok::<(), PathError>(())
```

