assert_eq!(unsafe{p.create_slice_unchecked(..)}, p);
assert_eq!(unsafe{p.create_slice_unchecked(..1)}, path!("/hi"));
assert_eq!(unsafe{p.create_slice_unchecked(1..)}, path!("/ho"));
assert_eq!(unsafe{p.create_slice_unchecked(1..1)}, Path::new());
# Ok::<(), PathError>(())
```

