2020.docs:
Creates a new [`Path`] by appending a [`Component`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow25::prelude::*;
let p0: Path = Path::new();
let p1 = p0.append_component(component!("hi"))?;
let p2 = p1.append_component(component!("ho"))?;
assert_eq!(
    p2.append_component(component!("too_")),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

4.docs:
The type of [SubspaceIds](https://willowprotocol.org/specs/data-model/index.html#SubspaceId) used by [Willow25](https://macromania--macromania.deno.dev/specs/willow25/index.html#willow25_data_model).

Subspaces group Willow data within the same [namespace](`NamespaceId`) into independent collections  entries with nonequal subspace ids cannot overwrite each other. Subspaces further play a role in access control for Willow: subspace ids are public keys of a [digital signature system](https://ed25519.cr.yp.to/), and knowledge of the corresponding secret key allow you to issue write entries to a subspace, and to delegate access to other users  see the [`meadowcap`] module for more details.

That all said, you can also simply think of subspace ids as glorified `[u8; 32]` arrays. That perspective should be sufficient as long as you do not need to care about cryptographic details.

You will typically obtain a subspace id either by [randomly generating a key pair](super::randomly_generate_subspace), by cloning an existing subspace id, or by creating it from raw bytes via [`SubspaceId::from_bytes`]. See the [Willow25 specification](https://willowprotocol.org/specs/willow25/index.html#willow25_crypto) if you want to work with raw bytes  while every `[u8; 32]` can be converted into a [`SubspaceId`], some of these do not correspond to canonic public key encodings and thus always fail signature verification.

```
use rand::rngs::OsRng;
use willow25::prelude::*;

let mut csprng = OsRng; // cryptographically secure pseudo-random number generator
let (_subspace_id, _secret) = randomly_generate_subspace(&mut csprng);

let subspace_id2 = SubspaceId::from_bytes(&[17; SUBSPACE_ID_WIDTH]);
assert_eq!(subspace_id2.as_bytes(), &[17; 32]);
```

885.docs:
Functionality around Willow [Entries](https://willowprotocol.org/specs/data-model/index.html#Entry).

Entries are the metadata by which payload strings are identified in Willow  see the [`Entry`] struct for more information.

Applications can construct concrete entries via [`EntryBuilders`](EntryBuilder). Code which merely needs to inspect entries should make use of the [`Entrylike`] trait, however. This trait describes exactly which information an entry provides, and lets code abstract over any *specific* representation (such as the [`Entry`] struct) of entries.

This module further provides some concrete types for the different fields of entries: [`NamespaceId`] for the [namespace_id](https://willowprotocol.org/specs/data-model/index.html#entry_namespace_id), [`SubspaceId`] for the [subspace_id](https://willowprotocol.org/specs/data-model/index.html#entry_subspace_id), [`Timestamp`] for the [timestamp](https://willowprotocol.org/specs/data-model/index.html#entry_timestamp), and [`PayloadDigest`] for the [payload_digest](https://willowprotocol.org/specs/data-model/index.html#entry_payload_digest).

```
use willow25::prelude::*;
# #[cfg(feature = "std")] {

// Create an entry for a specific payload, timestamped with the current time.
let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!("/vacation/plan"))
    .now().expect("The std library should be able to give the current time")
    .payload(b"See many sights!")
    .build().unwrap();

// Create a new entry based on the previous one, with greater timestamp and another payload.
let updated = Entry::prefilled_builder(&entry)
    .timestamp(entry.timestamp() + 5.minutes())
    .payload(b"See *all* the sights!")
    .build().unwrap();

// Assert that the new entry would overwrite the old entry if both were inserted in a store.
assert!(updated.prunes(&entry));
# }
```

1639.docs:
Creates a new `AreaOfInterest` from its constituent [`Area`], [max_count](https://willowprotocol.org/specs/grouping-entries/#aoi_count), and [max_size](https://willowprotocol.org/specs/grouping-entries/#aoi_size).

A [`max_count`](https://willowprotocol.org/specs/grouping-entries/#aoi_count) of [`u64::MAX`] indicates that there is no limit on the number of entries. A [`max_size`](https://willowprotocol.org/specs/grouping-entries/#aoi_size) of [`u64::MAX`] indicates that there is no limit on the total [payload_lengths](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) of the entries.

```
use willow25::prelude::*;

let aoi = AreaOfInterest::new(
    Area::new(None, Path::new(), TimeRange::new_closed(0.into(), 17.into())),
    NonZeroU64::new(5).unwrap(),
    400,
);;

assert_eq!(
    aoi.area(),
    &Area::new(None, Path::new(), TimeRange::new_closed(0.into(), 17.into())),
);
assert_eq!(aoi.max_count(), NonZeroU64::new(5).unwrap());
assert_eq!(aoi.max_size(), 400);
```

531.docs:
An [authorisation token](https://willowprotocol.org/specs/data-model/index.html#AuthorisationToken), cryptographically certifying that an entry was created by somebody who had the permission to do so.

#### Examples

Authorising an entry of your own:

```
use rand::rngs::OsRng;
use willow25::prelude::*;
use willow25::authorisation::raw::*;

# #[cfg(feature = "dev")] {
let mut csprng = OsRng;
let (subspace_id, secret) = randomly_generate_subspace(&mut csprng);
let namespace_id = NamespaceId::from_bytes(&[17; 32]);

let my_entry = Entry::builder()
    .namespace_id(namespace_id.clone())
    .subspace_id(subspace_id.clone())
    .path(path!("/ideas"))
    .timestamp(12345)
    .payload(b"chocolate with mustard")
    .build().unwrap();

let mut cap = WriteCapability::new_communal(
    namespace_id.clone(),
    subspace_id.clone(),
);

let auth_token = AuthorisationToken::new_for_entry(&my_entry, &cap, &secret).unwrap();

assert!(auth_token.does_authorise(&my_entry));
# }
```

Verifying an untrusted entry, creating the authorisation token from raw parts, which fails if those parts are invalid:

```
use rand::rngs::OsRng;
use willow25::prelude::*;
use willow25::authorisation::raw::*;

# #[cfg(feature = "dev")] {
let mut csprng = OsRng;
let (subspace_id, secret) = randomly_generate_subspace(&mut csprng);
let namespace_id = NamespaceId::from_bytes(&[17; 32]);

let my_entry = Entry::builder()
    .namespace_id(namespace_id.clone())
    .subspace_id(subspace_id.clone())
    .path(path!("/ideas"))
    .timestamp(12345)
    .payload(b"chocolate with mustard")
    .build().unwrap();

let mut cap = WriteCapability::new_communal(
    namespace_id.clone(),
    subspace_id.clone(),
);

let auth_token = AuthorisationToken::new(
    cap,
    SubspaceSignature::from([18; 64]), // Invalid signature, verification will fail.
);

assert!(!auth_token.does_authorise(&my_entry));
# }
```

