1472.docs:
Returns whether `self` and `other` describe non-equal coordinates, i.e., whether their [subspace ids](Keylike::subspace_id), [paths](Keylike::path), and [timestamps](Coordinatelike::timestamp) are not all equal.

# Examples

```
use willow25::prelude::*;

assert!(
    !(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25)),
        )
);
assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([1; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        )
);
assert!(
    (SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!(""), Timestamp::from(25))
        .coordinate_ne(
            &(SubspaceId::from([0; SUBSPACE_ID_WIDTH]), path!("/nope"), Timestamp::from(25))
        )
);
```

891.docs:
Returns whether this entry is strictly [older](https://willowprotocol.org/specs/data-model/index.html#entry_newer) than another entry. See also [`EntrylikeExt::cmp_recency`] and [`EntrylikeExt::is_newer_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::prunes`] method checks for that directly.

# Examples

```
use willow25::prelude::*;

let entry = Entry::builder()
    .namespace_id([0; 32].into())
    .subspace_id([1; 32].into())
    .path(path!(""))
    .timestamp(12345)
    .payload_digest([1; 32].into())
    .payload_length(17)
    .build().unwrap();

assert!(!entry.is_older_than(&entry));

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert!(!entry.is_older_than(&lesser_timestamp));

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest([0; 32].into()).build().unwrap();
assert!(!entry.is_older_than(&lesser_digest));

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert!(!entry.is_older_than(&lesser_length));

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert!(entry.is_older_than(&greater_timestamp));

let greater_digest = Entry::prefilled_builder(&entry).payload_digest([2; 32].into()).build().unwrap();
assert!(entry.is_older_than(&greater_digest));

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert!(entry.is_older_than(&greater_length));
```

10.docs:
An [`Area`](https://willowprotocol.org/specs/grouping-entries/#Area) is a box in three-dimensional willow space, consisting of all entries matching either a single [`SubspaceId`] or entries of arbitrary [`SubspaceIds`](SubspaceId), prefixed by some [`Path`], and a [`TimeRange`](super::TimeRange).

Areas are the default way by which application developers should aggregate entries. See [the specification](https://willowprotocol.org/specs/grouping-entries/#areas) for more details.

```
use willow25::prelude::*;

let a1 = Area::new(None, Path::new(), TimeRange::new_closed(0.into(), 17.into()));

assert!(a1.includes(&([5; 32].into(), Path::new(), Timestamp::from(9))));
assert_eq!(a1.subspace(), None);

let a2 = Area::new(Some([42; 32].into()), Path::new(), TimeRange::new_open(15.into()));
assert_eq!(
    a1.intersection(&a2),
    Ok(Area::new(
        Some([42; 32].into()),
        Path::new(),
        TimeRange::new_closed(15.into(), 17.into()),
    )),
);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/#Area)

