2129.docs:
Creates the greatest possible [`Path`] (with respect to lexicographical ordering, which is also the [`Ord`] implementation of [`Path`]).

It consists of a single component of `255` bytes, followed by 4095 empty components.

#### Complexity

Runs in `O(MCC + MPL)`. Performs a single allocation of `O(MPL)` bytes.

#### Examples

```
use willow25::prelude::*;
use order_theory::GreatestElement;

let p = Path::greatest();
assert_eq!(p.component_count(), 4096);
assert_eq!(p.component(0).unwrap().len(), 4096);
assert!(p.component(1).unwrap().is_empty());
assert!(p.component(4095).unwrap().is_empty());
```

467.docs:
Returns by value the [area to which this grants access](https://willowprotocol.org/specs/meadowcap/index.html#cap_granted_area).

Prefer using [`includes`](ReadCapability::includes), [`includes_area`](ReadCapability::includes_area) or [`granted_area_ref`](ReadCapability::granted_area_ref) whenever applicable, as these are more efficient.

```
use rand::rngs::OsRng;
use willow25::{prelude::*, authorisation::*};

# #[cfg(feature = "dev")] {
let mut csprng = OsRng;
let (namespace_id, namespace_secret) = randomly_generate_namespace(&mut csprng);
let (subspace_id, subspace_secret) = randomly_generate_subspace(&mut csprng);

let mut cap = ReadCapability::new_owned(
    &namespace_secret,
    subspace_id.clone(),
);

assert_eq!(cap.granted_area(), Area::full());

let new_receiver = SubspaceId::from_bytes(&[18; 32]);
cap.delegate(&subspace_secret, Area::new_subspace_area(subspace_id.clone()), new_receiver.clone());

assert_eq!(cap.granted_area(), Area::new_subspace_area(subspace_id));
